import React from 'react';
import { Form, Input, Button } from 'antd';

const Profile = () => {
    return (
        <>
            <br />
            <div>
                <h3>닉네임 수정</h3>
                <Form style={{ margin : '20px'}}>
                    <Input ></Input>
                    <Button type="primary">수정</Button>
                </Form>
            </div>
        </>
    );
};

export default Profile;
